"original": |2-
        If supplied but the "job-hold-until" operation attribute itself is
        not supported, the Printer accepts the request, returns the
        unsupported attribute with the out-of-band 'unsupported' value in
        the Unsupported Attributes group according to Section 4.1.7,
        returns the 'successful-ok-ignored-or-substituted-attributes'
        status-code, and restarts the Job, i.e., ignores the
        "job-hold-until" attribute.
"fixed": |-
  - If supplied but the "job-hold-until" operation attribute itself is not supported, the Printer accepts the request, returns the unsupported attribute with the out-of-band 'unsupported' value in the Unsupported Attributes group according to Section 4.1.7, returns the 'successful-ok-ignored-or-substituted-attributes' status-code, and restarts the Job, i.e., ignores the "job-hold-until" attribute.
"ko": |-
  - 제공되었지만 "job-hold-until" 작업 속성 자체가 지원되지 않는 경우 프린터는 요청을 수락하고 섹션 4.1에 따라 지원되지 않는 속성 그룹의 대역 외 '지원되지 않음' 값과 함께 지원되지 않는 속성을 반환합니다. 7에서는 '성공-확인-무시 또는 대체 속성' 상태 코드를 반환하고 작업을 다시 시작합니다. 즉, "job-hold-until" 속성을 무시합니다.
